BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" varchar NOT NULL);
CREATE TABLE "users" ("id" SERIAL PRIMARY KEY NOT NULL, "email" varchar DEFAULT '' NOT NULL, "encrypted_password" varchar DEFAULT '' NOT NULL, "reset_password_token" varchar, "reset_password_sent_at" timestamp, "remember_created_at" timestamp, "sign_in_count" integer DEFAULT 0 NOT NULL, "current_sign_in_at" timestamp, "last_sign_in_at" timestamp, "current_sign_in_ip" varchar, "last_sign_in_ip" varchar, "created_at" timestamp, "updated_at" timestamp, "user_token" varchar, "user_refresh_token" varchar, "auth_data" text, "zip_code" integer, "token_refreshes_at" integer);
CREATE TABLE "albums" ("id" SERIAL PRIMARY KEY NOT NULL, "artist" varchar NOT NULL, "album_title" varchar NOT NULL, "release_date" date NOT NULL, "thumbnail" varchar, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL, "spotify_id" varchar, "spotify_details" varchar);
CREATE TABLE "favorites" ("id" SERIAL PRIMARY KEY NOT NULL, "user_id" integer, "album_id" integer, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL, "id_code" varchar);
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
CREATE UNIQUE INDEX "index_users_on_email" ON "users" ("email");
CREATE UNIQUE INDEX "index_users_on_reset_password_token" ON "users" ("reset_password_token");
CREATE INDEX "index_favorites_on_user_id" ON "favorites" ("user_id");
CREATE INDEX "index_favorites_on_album_id" ON "favorites" ("album_id");
COMMIT;
